import React, { Component } from 'react';
import Table from '../table/Table';
import './Appointments.css';

const headers = [
  {
    key: 'title',
    label: 'Title',
  },
  {
    key: 'price',
    label: 'Price',
  },
  {
    key: 'timelimit',
    label: 'Timelimit',
  },
  {
    key: 'dateCreated',
    label: 'Date Created',
  },
];
const data = [
  {
    title: 'First',
    price: 'First',
    timelimit: 'First',
    dateCreated: 'First',
  },
  {
    title: 'Second',
    price: 'Second',
    timelimit: 'Second',
    dateCreated: 'Second',
  },
];

class Appointments extends Component {
  getTableOptions = () => {
    const options = {
      customComponents: {
        test: {
          component: () => <div>Test</div>,
        },
      },
    };

    return options;
  };
  render() {
    return (
      <div className='appointments_table'>
        <Table data={data} headers={headers} options={this.getTableOptions()} />
      </div>
    );
  }
}

export default Appointments;
